decode_msg_2_doit('Profile', Bin, TrUserData) -> id(decode_msg_Profile(Bin, TrUserData), TrUserData);
decode_msg_2_doit('Profiles', Bin, TrUserData) -> id(decode_msg_Profiles(Bin, TrUserData), TrUserData);
decode_msg_2_doit('ProfileEntitlement', Bin, TrUserData) -> id(decode_msg_ProfileEntitlement(Bin, TrUserData), TrUserData);
decode_msg_2_doit('Subscription', Bin, TrUserData) -> id(decode_msg_Subscription(Bin, TrUserData), TrUserData);
decode_msg_2_doit('PacerSetting', Bin, TrUserData) -> id(decode_msg_PacerSetting(Bin, TrUserData), TrUserData).



